b'Jorginho on Malmo win:

"We need to believe in what we are doing. It was 4-0 and we didn't stop. We kept pushing, pressing and that's a good thing. We need to keep working like this, stay humble because it's still a long year."

@ChelseaFC'

b'Jorginho on Malmo win:

"I'm more happy for the performance [than the result] that the whole team did because everyone worked very hard and this is the way we have to keep working. Not just for me, something the whole team did."

